import ExpenseItem from "./ExpenseItem";

const ExpensesList = (props) => {

    return (
        <div>
            {props.expensesToDisplay.length === 0 ? <p>No expenses. If you add an expense it will show here! </p> : props.expensesToDisplay
                .map(e => <ExpenseItem key={e.id}
                                    title={e.title}
                                    amount={e.amount}
                                    date={e.date} />) }
        </div>
    )
}


export default ExpensesList;
